package entidade;


public class Pedido {

	private Integer id;
	private Integer cod_usu;
	private Integer cod_liv;

	public Pedido() {
		// TODO Auto-generated constructor stub
	}

	public Integer getId() {
		return id;
	}

	public void setId(Integer id) {
		this.id = id;
	}

	public Integer getCod_usu() {
		return cod_usu;
	}

	public void setCod_usu(Integer cod_usu) {
		this.cod_usu = cod_usu;
	}

	public Integer getCod_liv() {
		return cod_liv;
	}

	public void setCod_liv(Integer cod_liv) {
		this.cod_liv = cod_liv;
	}
	
	
	
}
